void IMG_Bootload()
{		
	  for(uint8_t t=0;t<5;t++){
			for(uint8_t j=0;j<128;j++)
			{
				for(uint8_t i=0;i<160;i++)
				{
					if (bootload[i][j])
						TFT_DrawPoint(i, j, WHITE);
					else
						TFT_DrawPoint(i, j, BLACK);
				}
			}
		}
}